        <script type="text/javascript">
            function getCookie(name) {
                var dc = document.cookie;
                var prefix = name + "=";
                var begin = dc.indexOf("; " + prefix);
                if (begin == -1) {
                    begin = dc.indexOf(prefix);
                    if (begin != 0) return null;
                }
                else
                {
                    begin += 2;
                    var end = document.cookie.indexOf(";", begin);
                    if (end == -1) {
                    end = dc.length;
                    }
                }
                // because unescape has been deprecated, replaced with decodeURI
                //return unescape(dc.substring(begin + prefix.length, end));
                return decodeURI(dc.substring(begin + prefix.length, end));
            } 
            function showmodal() {
                document.getElementsByClassName("modal")[0].style.top = "20px";
            }
            function hidemodal() {
                if (document.cookie.replace(/(?:(?:^|.*;\s*)info\s*\=\s*([^;]*).*$)|^.*$/, "$1") !== "true") {
                    document.getElementsByClassName("modal")[0].style.top = "-300px";
                    document.cookie = "info=true; expires=Fri, 31 Dec 9999 23:59:59 GMT";
                }
            }
            window.onload = function() {
                if (getCookie("info") == null) {
                    showmodal()
                }
            };
        </script>
